import React, { useState } from 'react'
import './Login.css'
// import 'antd/dist/antd.css';
// import { Form, Input, Button, Checkbox } from 'antd';
import { Link } from 'react-router-dom';
import { ClockCircleFilled } from '@ant-design/icons';
import logo from '..';



function Login() {

    const [idval, setidval] = useState("");
    const [pwval, setpwval] = useState("");

    const handlesubmit = (event) => {
        event.preventDefualt();
    }

    return (
        <div className="main-login">
            로그인 페이지 <br />
            <Link to='register'>회원가입</Link>
            <div className="login-contain">
                <div className="left-side">
    
                    <Icon component={() => <ClockCircleFilled fill="green"/>}/>
                    <form onSubmit={handlesubmit}>
                        <label for="id">ID</label>
                        <input type="id" id="id" placeholder="Enter your ID"
                            value={idval} onChange={(e) => { setidval(e.target.value) }} />
                        <label for="pw">Password</label>
                        <input type="password" id="pw" placeholder="Enter your Password"
                            value={pwval} onChange={(e) => setpwval(e.target.value)} />
                        <button type="submit" id="sub_btn">로그인</button>
                    </form>
                </div>
                <div className="right-side">

                </div>

            </div>

        </div>
    )
}

